import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function ListEmployees(employees) {
  const ListEmployees = employees.map(employee =>
    <li>Employee {employee.id} {employee.name}
      <ul>{employee.bio}</ul>
    </li>
  )
}

function App() {
  const [employees, setEmployees] = useState({ })

  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      console.log("SUCCESS", response)
      setEmployees(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div className="App">
      <header className="App-header">
        Full Employee List
      </header>
      <div>
        {employees.status === 200 ?
          <h3>{ }</h3>
          :
          <h3>LOADING</h3>
        }
      </div>
    </div>
  );
}

export default App;
